import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Chatbot from './Pages/Chatbot/Chatbot';

function App() {
    return (
        <Router>
            <div>
                <Routes>
                    <Route path="/chatbot" element={<Chatbot />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
